import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import { Route, Routes } from 'react-router';
import HackerNews from './compomenets/pages/HackerNews';
import Login from './compomenets/pages/login';
import Main from './compomenets/pages/main';

function App(authService) {
  return (
   <>
    <Routes>
      <Route path="/" exact={true} element={<Login/>}/>
      <Route 
        path="/main/:userId" 
        exact={true} 
        element={<Main authService={authService}/>}/>
      <Route path="/hacker" exact={true} element={<HackerNews/>}/>
    </Routes>
   </>
  );
}

export default App;
